import React from 'react';
import { NavLink } from 'react-router-dom';
import Home from '../pages/Home';

const Nav = () => {
    return (
        <div>
            <ul>
                <NavLink to="/">Home</NavLink>
            </ul>
        </div>
    );
};

export default Nav;
